content.css:
.common-flex-1 {
  flex: 1;
}
.common-height-0px {
  height: 0px;
}
.common-width-0px {
  width: 0px;
}
.common-table-layout-fixed > table {
  table-layout: fixed;
}
.common-table-width-100-percent > table {
  width: 100%;
}
.common-table-height-100-percent {
  height: 100%;
}
.common-table-height-100-percent > table {
  height: 100%;
}
.common-table-maxWidth-100-percent > table {
  max-width: 100%;
}
.common-table-layout-auto > table {
  table-layout: auto;
}
.common-triangle-left::after {
  content: "\25C4";
}
.common-triangle-right::after {
  content: "\25BA";
}
.common-triangle-up::after {
  content: "\25B2";
}
.common-triangle-down::after {
  content: "\25BC";
}
.common-fadein-visible {
  opacity: 0;
  transition-property: opacity;
  display: block !important;
}
.common-fadein-visually-visible {
  opacity: 1;
}
.common-fadeout-hidden {
  display: none;
}
body {
  -ms-overflow-style: scrollbar;
}
* {
  font-family: 'Segoe UI', wf_segoe-ui_semibold, helvetica, arial, sans-serif;
}
input,
select {
  font-family: 'Segoe UI Semibold', wf_segoe-ui_semibold, helvetica, arial, sans-serif;
}
.demxButton button {
  font-family: 'Segoe UI Semibold', wf_segoe-ui_semibold, helvetica, arial, sans-serif;
  background-image: none;
  box-shadow: none;
  background-color: #C8C8C8;
  padding: 0px 17px;
  border: 2px solid #C8C8C8;
  border-radius: 0;
  text-shadow: none;
  font-size: 14px;
  width: auto;
  white-space: nowrap;
  color: #000;
  transition: color 0.2s, background-color 0.2s, border-color 0.2s;
}
.demxButton:active:hover button,
.demxButton:focus button,
.demxButton:focus:hover button,
.demxButton:hover button {
  border-color: #000;
  background-color: #F4F4F4;
  color: #000;
  outline: 0;
}
.demxButton:active button {
  background-color: #666;
  border-color: #666;
  color: #000;
}
.demxButton.primary button {
  background-color: #F2C811;
  border-color: #F2C811;
  color: #000;
}
.demxButton.primary:active button,
.demxButton.primary:focus button,
.demxButton.primary:hover button {
  border-color: #000;
  color: #000;
}
.demxButton.primary:active:hover button,
.demxButton.primary:focus:hover button {
  background-color: #CDA521;
}
.demxButton.disabled button,
.demxButton.disabled.primary button,
.demxButton[disabled] button,
.demxButton[disabled].primary button {
  background-color: #F4F4F4;
  border-color: #F4F4F4;
  color: #A6A6A6;
  cursor: default;
}
.demxButton.disabled.primary:active button,
.demxButton.disabled.primary:focus button,
.demxButton.disabled.primary:hover button,
.demxButton.disabled:active button,
.demxButton.disabled:focus button,
.demxButton.disabled:hover button,
.demxButton[disabled].primary:active button,
.demxButton[disabled].primary:focus button,
.demxButton[disabled].primary:hover button,
.demxButton[disabled]:active button,
.demxButton[disabled]:focus button,
.demxButton[disabled]:hover button {
  background-color: #F4F4F4;
  border-color: #F4F4F4;
  color: #A6A6A6;
}
.common-image-btnClose {
  background-image: url(data:image/svg+xml;base64,);
}
.control.button {
  display: flex;
  flex: 1;
  cursor: pointer;
  color: black !important;
}
.control.button > button {
  cursor: pointer;
  outline: none;
}
.control.button.width-100percent > button {
  flex: 1;
  width: 100%;
}
.control.button.disabled {
  cursor: default;
}
.control.button.disabled > button {
  cursor: default;
}
.control.comboBox {
  display: flex;
}
.control.comboBox > select {
  outline: none;
}
.control.comboBox.width-100percent {
  flex: 1;
}
.control.comboBox.width-100percent > select {
  width: 100%;
}
div.control.warningMessage div {
  background-color: orange;
  border-radius: 15px;
  position: fixed;
  width: 200px;
  z-index: 100;
  height: 50px;
  display: none;
  color: white;
  text-align: center;
}
.control.contextMenu {
  position: fixed;
  min-width: 20px;
  min-height: 20px;
  /*border: 1px solid gray;*/
  box-shadow: 0 1px 4px rgba(0, 0, 0, 0.5);
  display: none;
  z-index: 100000;
  background-color: white;
  color: black;
}
.control.contextMenu.open {
  display: block;
}
.control.contextMenu > .dContentContainer {
  will-change: transform;
}
.control.contextMenu > .dContentContainer > .dMenuElement {
  text-align: left;
  padding: 5px 5px;
  cursor: pointer;
}
.control.contextMenu > .dContentContainer > .dMenuElement:hover {
  background-color: lightgray;
}
.control.datePickerPanel {
  display: none;
  background-color: white;
  box-shadow: 0 1px 5px 0 rgba(0, 0, 0, 0.15);
  font-size: 12px;
  white-space: nowrap;
  flex-direction: row;
  font-weight: normal;
  position: fixed;
  top: 0px;
  left: 0px;
  z-index: 100000;
  border: 1px solid black;
  grid-auto-columns: min-content;
  grid-auto-rows: min-content;
  -ms-grid-columns: min-content;
  -ms-grid-rows: min-content;
}
.control.datePickerPanel > .dDatePicker {
  /*width: 200px;*/
  grid-column: 1;
  -ms-grid-column: 1;
}
.control.datePickerPanel > .dDatePicker > .dHeader {
  display: flex;
  flex-direction: row;
}
.control.datePickerPanel > .dDatePicker > .dHeader > .dMonthNameAndYear {
  /*flex: 1;*/
  padding-left: 5px;
  padding-right: 5px;
  color: #4d4d4d;
  opacity: 0.8;
  align-self: center;
}
.control.datePickerPanel > .dDatePicker > .dHeader > .dPrev {
  /*width: 30px;*/
  /*font-size: 18px;*/
  font-family: Courier New, Courier, monospace;
  cursor: pointer;
  text-align: center;
  align-self: center;
}
.control.datePickerPanel > .dDatePicker > .dHeader > .dPrev:hover {
  color: gray;
}
.control.datePickerPanel > .dDatePicker > .dHeader > .dNext {
  /*width: 30px;*/
  /*font-size: 18px;*/
  font-family: Courier New, Courier, monospace;
  cursor: pointer;
  text-align: center;
  align-self: center;
}
.control.datePickerPanel > .dDatePicker > .dHeader > .dNext:hover {
  color: gray;
}
.control.datePickerPanel > .dDatePicker > .dContent {
  display: flex;
  flex-direction: row;
  /*width: auto;
            white-space: nowrap;*/
}
.control.datePickerPanel > .dDatePicker > .dContent > .control.tableGrid > .table-cell {
  border: 0px;
  justify-content: center;
  cursor: pointer;
  padding: 2px;
  text-align: center;
  /*min-width: 0px;
                        min-width: unset;
                        width: auto;
                        max-width: unset;
                        word-break: keep-all;
                        white-space: nowrap;*/
}
.control.datePickerPanel > .dDatePicker > .dContent > .control.tableGrid > .table-cell > .dTextContainer {
  text-align: center;
}
.control.datePickerPanel > .dDatePicker > .dContent > .control.tableGrid > .table-cell:hover {
  background-color: lightgray;
}
.control.datePickerPanel > .dDatePicker > .dContent > .control.tableGrid > .table-cell.empty {
  cursor: default;
  background-color: unset;
}
.control.datePickerPanel > .dDatePicker > .dContent > .control.tableGrid > .table-cell.originalDate {
  background-color: orange;
}
.control.datePickerPanel > .dDatePicker > .dContent > .control.tableGrid > .table-cell.currentDate {
  background-color: black;
  color: white;
}
.control.datePickerPanel > .dTimePicker {
  grid-column: 2;
  -ms-grid-column: 2;
  display: none;
  flex-direction: column;
  padding: 5px;
  /*width: 120px;*/
  overflow: hidden;
}
.control.datePickerPanel > .dTimePicker > .dCenter {
  /*flex: 1;
            display: flex;*/
}
.control.datePickerPanel > .dTimePicker > .dCenter > .dHour {
  /*flex: 1;*/
}
.control.datePickerPanel > .dTimePicker > .dCenter > .dHour > .control.numberPicker > .dTextBoxContainer > .control.textBox > input {
  min-width: 40px;
}
.control.datePickerPanel > .dTimePicker > .dCenter > .dMinute {
  /*flex: 1;*/
}
.control.datePickerPanel > .dTimePicker > .dCenter > .dSecond {
  /*flex: 1;*/
}
.control.datePickerPanel.open {
  /*display: flex;*/
  display: grid;
  display: -ms-grid;
}
.control.datePickerPanel.dateTimePicker > .dTimePicker {
  display: block;
}
.control.datePicker {
  /*position: relative;*/
  display: flex;
}
.control.datePicker > .dTextBoxContainer {
  display: flex;
}
.control.datePicker > .dTextBoxContainer > .control.textBox {
  flex: 1;
}
.control.datePicker > .dTextBoxContainer > .control.textBox > input {
  text-align: center;
  outline: none;
  /*padding: 0px;*/
  border: 0px;
  /*background-color: transparent;*/
}
.control.datePicker.width-100percent {
  flex: 1;
}
.control.datePicker.width-100percent > .dTextBoxContainer {
  width: 100%;
}
.control.datePicker.width-100percent > .dTextBoxContainer > .control.textBox > input {
  flex: 1;
  width: 100%;
}
.control.datePicker.invalid {
  background-color: red;
}
.control.datePicker.invalid > .dTextBoxContainer > .control.textBox > input {
  color: white !important;
  background-color: red !important;
}
.control.dialog {
  display: none;
  position: absolute;
  top: 0px;
  left: 0px;
  right: 0px;
  bottom: 0px;
  z-index: 20000;
  /*> .dBlocker {
        position: absolute;
        top: 0px;
        left: 0px;
        right: 0px;
        bottom: 0px;
        background-color: gray;
        opacity: 0.5;
    }*/
}
.control.dialog > .dDialogContainer {
  position: absolute;
  top: 50%;
  left: 50%;
  transform: translateX(-50%) translateY(-50%);
  background-color: white;
  box-shadow: 1px 1px 2px 1px;
  font-size: 12px;
  flex-direction: column;
  display: flex;
  z-index: 100;
  min-width: 200px;
  min-height: 150px;
}
.control.dialog > .dDialogContainer * {
  font-size: 12px;
}
.control.dialog > .dDialogContainer > .dHeader {
  padding: 5px;
  font-weight: bold;
  display: flex;
}
.control.dialog > .dDialogContainer > .dHeader > .dTitle {
  flex: 1;
}
.control.dialog > .dDialogContainer > .dHeader > .dButtonContainer {
  align-self: center;
}
.control.dialog > .dDialogContainer > .dHeader > .dButtonContainer > .dClose {
  width: 15px;
  height: 15px;
  cursor: pointer;
  background-size: 15px 15px;
  background-repeat: no-repeat;
}
.control.dialog > .dDialogContainer > .dHeader > .dButtonContainer > .dClose:hover {
  opacity: 0.5;
}
.control.dialog > .dDialogContainer > .dContent {
  flex: 1;
  display: flex;
}
.control.dialog > .dDialogContainer > .dContent > div {
  display: flex;
  flex: 1;
}
.control.dialog > .dDialogContainer > .dButtonsContainer {
  display: flex;
  flex-direction: row;
}
.control.dialog > .dDialogContainer > .dButtonsContainer > div {
  padding: 3px;
}
.control.dialog.open {
  display: block;
}
.control.dialog.dragged > .dWindowContainer {
  transform: none;
}
.ui-resizable-handle.ui-resizable-se.ui-icon.ui-icon-gripsmall-diagonal-se {
  z-index: 100 !important;
  right: -8px !important;
  bottom: -8px !important;
}
.ui-resizable-handle.ui-resizable-s {
  height: 12px !important;
  bottom: -6px !important;
}
.ui-resizable-handle.ui-resizable-e {
  width: 12px !important;
  right: -6px !important;
}
.control.table {
  display: flex;
  flex: 1;
  flex-direction: column;
}
.control.table > .table-row {
  /*height: 40px;*/
  display: flex;
}
.control.table > .table-row > .table-cell {
  flex: 1;
  padding: 5px;
  align-items: center;
  display: flex;
}
.control.table.htmlTable {
  display: table;
  width: 100%;
}
.control.table.htmlTable > .table-row {
  display: table-row;
}
.control.table.htmlTable > .table-row > .table-cell {
  display: table-cell;
  text-align: center;
  vertical-align: middle;
}
.control.table.absolute {
  position: relative;
  display: flex;
  flex-direction: row;
}
.control.table.absolute > .table-cell {
  white-space: nowrap;
  position: absolute;
}
.control.table.absolute.noSpanOptimized > .dColumn > .table-cell {
  white-space: nowrap;
}
.control.tableGrid {
  position: relative;
}
.control.tableGrid > .table-cell {
  white-space: nowrap;
}
.control.tableGrid.renderMode-cssGrid {
  display: -ms-grid;
  display: grid;
  grid-auto-columns: min-content;
  grid-auto-rows: min-content;
  -ms-grid-rows: min-content;
  -ms-grid-columns: min-content;
}
.control.textBox {
  display: flex;
}
.control.textBox > input {
  outline: 0px;
}
.control.textBox.width-100percent {
  flex: 1;
}
.control.textBox.width-100percent > input {
  /*flex: 1;*/
  width: 100%;
}
.control.textBox.backgroundColor-transparent > input {
  background-color: transparent;
  color: inherit;
}
.control.textBox.disabled > input {
  background-color: #F4F4F4;
  color: #A6A6A6;
}
.control.textArea {
  display: flex;
}
.control.textArea > textarea {
  border: 0px;
  outline: 0px;
}
.control.textArea > .dRichTextContainer {
  display: none;
}
.control.textArea.noResize > textarea {
  resize: none;
}
.control.textArea.width-100percent {
  flex: 1;
}
.control.textArea.width-100percent > textarea {
  flex: 1;
  width: 100%;
  /*padding: 0px;*/
}
.control.textArea.height-100percent {
  flex: 1;
}
.control.textArea.height-100percent > textarea {
  flex: 1;
  /*padding: 0px;*/
}
.control.textArea.richText {
  flex-direction: column;
}
.control.textArea.richText > div {
  width: 100% !important;
}
.control.textArea.richText > div > .nicEdit-main {
  padding: 0px;
  margin: 0px !important;
  min-height: 50px !important;
  width: 100% !important;
  outline: none;
}
.control.textArea.richText > textarea {
  display: none;
}
.control.textArea.richText > .dRichTextContainer {
  display: block;
}
.control.numberPicker {
  display: flex;
}
.control.numberPicker > .dTextBoxContainer {
  flex: 1;
  display: flex;
}
.control.numberPicker > .dTextBoxContainer > .control.textBox {
  flex: 1;
  display: flex;
}
.control.numberPicker > .dTextBoxContainer > .control.textBox > input {
  outline: 0px;
  border: 1px solid black;
}
.control.numberPicker > .dControlsContainer {
  overflow: hidden;
  align-self: center;
}
.control.numberPicker > .dControlsContainer > .dIncrease {
  cursor: pointer;
  align-self: center;
  padding-bottom: 1px;
}
.control.numberPicker > .dControlsContainer > .dIncrease:hover {
  opacity: 0.5;
}
.control.numberPicker > .dControlsContainer > .dDecrease {
  cursor: pointer;
  align-self: center;
  padding-top: 1px;
}
.control.numberPicker > .dControlsContainer > .dDecrease:hover {
  opacity: 0.5;
}
.control.numberPicker.width-100percent {
  flex: 1;
}
.control.numberPicker.width-100percent > .dTextBoxContainer {
  overflow: hidden;
}
.control.numberPicker.width-100percent > .dTextBoxContainer > .control.textBox input {
  /*flex: 1;*/
  width: 100%;
  overflow: hidden;
}
.control.numberPicker.backgroundColor-transparent > .dTextBoxContainer > .control.textBox input {
  background-color: transparent;
}
.control.numberPicker.invalid {
  color: white;
  background-color: red;
}
.control.numberPicker.invalid > .dTextBoxContainer > .control.textBox > input {
  color: white !important;
  background-color: red !important;
}
.control.numberPicker.disabled > .dControlsContainer {
  /*background-color: #F4F4F4;*/
  color: #A6A6A6;
}
.control.numberPicker.disabled > .dControlsContainer > .dIncrease {
  cursor: default;
}
.control.numberPicker.disabled > .dControlsContainer > .dIncrease:hover {
  opacity: unset;
}
.control.numberPicker.disabled > .dControlsContainer > .dDecrease {
  cursor: default;
}
.control.numberPicker.disabled > .dControlsContainer > .dDecrease:hover {
  opacity: unset;
}
.control.numberPicker.horizontalButtons > .dControlsContainer {
  display: flex;
}
.control.window {
  display: none;
  position: fixed;
  top: 0px;
  left: 0px;
  right: 0px;
  bottom: 0px;
  z-index: 20000;
}
.control.window > .dBlocker {
  position: fixed;
  top: 0px;
  left: 0px;
  right: 0px;
  bottom: 0px;
  background-color: gray;
  opacity: 0.5;
}
.control.window > .dWindowContainer {
  position: absolute;
  top: 50%;
  left: 50%;
  transform: translateX(-50%) translateY(-50%);
  background-color: white;
  box-shadow: 1px 1px 2px 1px;
  font-size: 12px;
  flex-direction: column;
  display: flex;
  z-index: 100;
  max-width: 100%;
  max-height: 100%;
}
.control.window > .dWindowContainer * {
  font-size: 12px;
}
.control.window > .dWindowContainer > .dHeader {
  padding: 5px;
  font-weight: bold;
  display: flex;
}
.control.window > .dWindowContainer > .dHeader:hover {
  cursor: grab;
  background-color: lightgray;
}
.control.window > .dWindowContainer > .dHeader > .dTitle {
  flex: 1;
}
.control.window > .dWindowContainer > .dHeader > .dButtonContainer {
  align-self: center;
}
.control.window > .dWindowContainer > .dHeader > .dButtonContainer > .dClose {
  width: 15px;
  height: 15px;
  cursor: pointer;
  background-size: 15px 15px;
  background-repeat: no-repeat;
}
.control.window > .dWindowContainer > .dHeader > .dButtonContainer > .dClose:hover {
  opacity: 0.5;
}
.control.window > .dWindowContainer > .dContent {
  /*flex: 1;*/
  display: flex;
  height: 100%;
}
.control.window > .dWindowContainer > .dContent > div {
  display: flex;
  flex: 1;
}
.browser-IE > .control.window > .dWindowContainer > .dContent .dButtonContainer > .control.button > button {
  min-width: 200px;
  transform: translate(-50%);
}
.control.window.open {
  display: block;
}
.control.window.dragged > .dWindowContainer {
  transform: none;
}
.control.window.wHeaderFormatting .dFormattingButtonContainer {
  justify-content: center;
}
.control.window.wHeaderFormatting .dFormattingButtonContainer > .control.button {
  flex: unset;
  margin: 0px 5px;
}
.ui-resizable-handle.ui-resizable-se.ui-icon.ui-icon-gripsmall-diagonal-se {
  z-index: 100 !important;
  right: -8px !important;
  bottom: -8px !important;
}
.ui-resizable-handle.ui-resizable-s {
  height: 12px !important;
  bottom: -6px !important;
}
.ui-resizable-handle.ui-resizable-e {
  width: 12px !important;
  right: -6px !important;
}
.control.colorPicker > .dClosedContainer {
  display: flex;
}
.control.colorPicker > .dClosedContainer > .dCurrentColorContainer {
  width: 20px;
  height: 20px;
  background-color: white;
  border: 1px solid black;
  border-radius: 2px;
  cursor: pointer;
}
.control.colorPicker > .dClosedContainer > .dCurrentColorContainer:hover {
  opacity: 0.7;
}
.control.colorPicker > .dClosedContainer > .dCurrentHexContainer > .control.textBox > input {
  /*border: 1px solid black;*/
}
.control.colorPicker.noValue > .dClosedContainer > .dCurrentColorContainer {
  background: repeating-linear-gradient(-45deg, white, white 5px, rgba(255, 0, 0, 0.1) 5px, rgba(255, 0, 0, 0.1) 10px);
}
.control.colorPicker > .dColorPickerContainer {
  display: none;
}
.control.colorPicker.opened > .dColorPickerContainer {
  display: block;
}
.control.colorPicker.width-100percent > .dClosedContainer > .dCurrentHexContainer {
  flex: 1;
}
.control.colorPicker.width-100percent > .dClosedContainer > .dCurrentHexContainer > .control.textBox > input {
  width: 100%;
}
.control.filter.open {
  z-index: 10000;
}
.control.filter.open .filter__dropdown {
  display: flex;
  max-height: 200px;
}
.control.filter .filter__icon {
  width: 1.2em;
  height: 1.2em;
  cursor: pointer;
  background-color: white;
  background-size: contain;
  background-image: url("data:image/svg+xml,%3Csvg xmlns=%27http://www.w3.org/2000/svg%27 enable-background=%27new 0 0 24 24%27 height=%2724px%27 viewBox=%270 0 24 24%27 width=%2724px%27 fill=%27%23c7c7c7%27%3E%3Cg%3E%3Cpath d=%27M0,0h24 M24,24H0%27 fill=%27none%27/%3E%3Cpath d=%27M7,6h10l-5.01,6.3L7,6z M4.25,5.61C6.27,8.2,10,13,10,13v6c0,0.55,0.45,1,1,1h2c0.55,0,1-0.45,1-1v-6 c0,0,3.72-4.8,5.74-7.39C20.25,4.95,19.78,4,18.95,4H5.04C4.21,4,3.74,4.95,4.25,5.61z%27/%3E%3Cpath d=%27M0,0h24v24H0V0z%27 fill=%27none%27/%3E%3C/g%3E%3C/svg%3E");
